export default function Home() {
  return (
    <div className='text-center p-10'>
      <h1 className='text-4xl font-bold mb-4'>Bienvenido a NEO_BLA_BLA</h1>
      <p className='text-lg mb-6'>Explora nuestras funciones:</p>
      <div className="flex justify-center gap-4 flex-wrap">
        <a href="/chat" className="bg-blue-500 text-white px-6 py-2 rounded hover:bg-blue-600">Chat con IA</a>
        <a href="/lecciones" className="bg-green-500 text-white px-6 py-2 rounded hover:bg-green-600">Lecciones</a>
        <a href="/ejercicios" className="bg-purple-500 text-white px-6 py-2 rounded hover:bg-purple-600">Ejercicios</a>
        <a href="/reserva" className="bg-orange-500 text-white px-6 py-2 rounded hover:bg-orange-600">Reservar clase</a>
      </div>
    </div>
  );
}
